import React, { useState, useEffect } from 'react';
import ModalStyle from './ModalStyle'; // Import your ModalStyle component

function App() {
  const [flag, setFlag] = useState(false);
  const [lastEventData, setLastEventData] = useState(null);

  useEffect(() => {
    // Make an API call to fetch the last event data
    axios.get('http://your-api-endpoint-for-last-event')
      .then((response) => {
        setLastEventData(response.data); // Set the last event data in the state
      })
      .catch((error) => {
        console.error('Error:', error);
      });
  }, []); // Empty dependency array to run this effect once on component mount

  const openModal = () => {
    setFlag(true);
  }

  const closeModal = () => {
    setFlag(false);
  }

  return (
    <div>
      <button onClick={openModal}>Open Modal</button>
      <ModalStyle flag={flag} close={closeModal} lastEventData={lastEventData} />
    </div>
  );
}

export default App;
